        public int Function1(int[] nums, int limit, int goal)
        {
            long count = 0;
            foreach (var n in nums)
            {
                count += n;
            }
            if (count == goal) return 0;
            count -= goal;
            if (Math.Abs(count) <= limit)
            {
                return 1;
            }
            else
            {
                //刚好可以整除
                if (Math.Abs(count) % limit == 0)
                {
                    return (int)(Math.Abs(count) / limit);
                }
                else
                {
                    return (int)(Math.Abs(count) / limit) + 1;
                }
            }
        }
    }
